(()=>{"use strict";document.addEventListener("DOMContentLoaded",(function(){document.querySelectorAll(".row-team__team svg").forEach((t=>{t.addEventListener("click",(t=>{t.target.closest("svg").classList.toggle("active");const e=t.target.closest(".team-item").querySelector(".info");e.classList.contains("info_active")?e.classList.remove("info_active"):e.classList.add("info_active")}))}))}))})();